// HomePage.js
import React from "react";
import Header from "../../components/ui/header/header";
import Footer from "../../components/ui/footer/footer";
import ReportButton from "./buttonReport";

function ReportPage() {
  return (
    <div>
      <Header />
      <ReportButton />
      <Footer />
    </div>
  );
}

export default ReportPage;
